import React, { Component } from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import { createBrowserHistory } from "history";
import './App.css';
import Home from './components/Home';
import DashBoard from './components/Dashboard';
import Settings from './components/Settings';
import Teams from './components/Teams';
import Error from './components/Error';


function App(){    
const customHistory = createBrowserHistory(); 
    const baseurl = "http://task-line.herokuapp.com";
    alert(baseurl);
        return(
            <main>
            <Switch>
                <Route path="/" history={customHistory} baseURL="http://task-line.herokuapp.com" component={Home} exact />
                <Route path="/dashboard" history={customHistory} baseURL={baseurl} component={DashBoard} />
                <Route path="/settings" history={customHistory} baseURL={baseurl} component={Settings} />
                <Route path="/teams" history={customHistory} baseURL={baseurl} component={Teams} />
                <Route history={customHistory} component={Error} />

            </Switch>
        </main>
        );


}
export default App;
